ControlPropertyState.AutoRuleBindingString:
Switch(
    VgEvento.Título
    ,
    "PARADA U-613",
    Switch(
        VarFunção,
        "parada",
        If(
            SltFormNovoEdit.Value = true,
            SubmitForm(FrmDadosParada),
            UpdateContext({VcPopUpAviso: true})
