                    'UsuáriosPARADA HDS: U-0106',
                    ID = FrmCadastraEditaUsuario.LastSubmit.ID
                ),
                {Funcao: vcFuncao}
            );
            UpdateContext({vcFuncao: Blank()}),
            "lv",
            SubmitForm(FrmFasesLV),
            "inspeção",
            SubmitForm(FrmEtapasInspeção)
        )
    ),
    "PARADA HDS: U-0106",/*_____________________________________________________________________________________________________________________*/
    Switch(
        VarFunção,
        "parada",
        UpdateContext({loading: true});
        If(
            SltFormNovoEdit.Value = true,
            SubmitForm(FrmDadosParada),
            UpdateContext(
                {
                    VcPopUpAviso: true,
                    loading: false
                }
            )
        ),
        "equipamentos",
        SubmitForm(FrmCadastroEquipamento);
        If(/*SE NÃO EXISTIREM ERROS NO FORMULÁRIO...*/
            IsBlank(FrmCadastroEquipamento.Error),
            UpdateContext({loading: true});
            /*ATIVA TELA DE LOADING*/
Patch(/*CORRIGE FALHAS DO FORMULÁRIO*/
                'EquipamentosPARADA HDS: U-0106',
                LookUp(
                    'EquipamentosPARADA HDS: U-0106',
                    ID = FrmCadastroEquipamento.LastSubmit.ID
                ),
                {
                    Servico: FrmCadastroEquipamento.LastSubmit.Servico,
                    RespCadastro: FrmCadastroEquipamento.LastSubmit.RespCadastro,
                    RespExecucao: FrmCadastroEquipamento.LastSubmit.RespExecucao
                }
            );
            UpdateContext(/*LIMPA VARIAVEIS USADAS NA CORREÇÃO DO FORMULÁRIO, DESLIGA LOADING*/
                {
                    vcServico: Blank(),
                    vcRespCadastro: Blank(),
                    vcRespExecucao: Blank(),
                    vcRespLancamento: Blank(),
                    loading: false
                }
            );
            ResetForm(FrmCadastroEquipamento),/*SE EXISTIREM FALHAS NO FORMULÁRIO*/
            Notify(/*AVISA USUÁRIO QUE O FORMULÁRIO FALHOU*/
                "Falha na entrega do formulário",
                NotificationType.Error
